import ConnectionManager from "./connection-manager"
import DataManager from "./data-manager"
import MapManager from "./map-manager"
import QueryBuilder from "./query-builder"

const TABLE = "tweets_nov_feb"
const WIDTH = 800
const HEIGHT = 800

// Map
///////////////////////////////////////
const map = MapManager().init()

// Connection
///////////////////////////////////////
let dataManager, connection

function setupConnection () {
  const connectionConfig = {
    protocol: "http",
    host: "mahakali.mapd.com",
    port: "9092",
    dbName: "mapd",
    user: "mapd",
    password: "HyperInteractive"
  }
  const connectionManager = ConnectionManager()
    .init(connectionConfig)
    .connect()
    .then(setupDataTable)
    .then(createCharts)
}

// Data
///////////////////////////////////////
function setupDataTable (_connection) {
  connection = _connection
  dataManager = DataManager()
    .init(crossfilter, connection)
  return dataManager.getCrossfilter(TABLE)
}

// Map
///////////////////////////////////////
function createCharts (cf) {

  const state = {
    mark: "hex",
    encoding: {
      x: {
        type: "quantitative",
        field: "lon",
        size: WIDTH
      },
      y: {
        type: "quantitative",
        field: "lat",
        size: HEIGHT
      },
      color: {
        type: "quantize",
        aggregate: "count(lang)",
        scale: {
          domain: "auto",
          range: [
            "#0d0887",
            "#2a0593",
            "#41049d",
            "#5601a4",
            "#6a00a8",
            "#7e03a8",
            "#8f0da4",
            "#a11b9b",
            "#b12a90",
            "#bf3984",
            "#cb4679",
            "#d6556d",
            "#e16462",
            "#ea7457",
            "#f2844b",
            "#f89540",
            "#fca636",
            "#feba2c",
            "#fcce25",
            "#f7e425",
            "#f0f921"
          ],
          default: "#0d0887",
          nullValue: "#0d0887"
        }
      },
      size: {
        type: "manual",
        value: 10
      }
    }
  }

  // Building query
  ///////////////////////////////////////
  const queryBuilder = QueryBuilder()
    .setConfig({
      crossfilter: cf,
      connector: connection,
      xDimension: dataManager.getDimension("lat"),
      yDimension: dataManager.getDimension("lon"),
      height: HEIGHT,
      width: WIDTH
    })
    .setState(state)

  const vegaQuery = queryBuilder.getQuery()
  

  // Query and render
  ///////////////////////////////////////
  dataManager.query(vegaQuery)
    .then((result) => {
      console.log("data", result)

      const dummy = "data:image/png;base64,"
      map.addImage(dummy)
    })
}

setupConnection()

